/**
 * Solves a quadratic system of equations of the form
 *      a * x + b * y = c
 *      x + y = 1
 * This can be understood as the intersection of the unit circle with a line.
 *      => y = (c - a x) / b
 *      => x + (c - a x) / b = 1
 *      => x b + c - 2 c a x + a x = b
 *      => (a + b) x - 2 a c x + (c - b) = 0
